import React from 'react'
import { BrowserRouter, Route, Routes } from 'react-router-dom'
import Homepage from './pages/homepage'


function App() {
  return (
    <BrowserRouter>
      <div>
        <Routes>
          <Route path={"/"} component={Homepage} exact />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
